import React from 'react';
import {Menu, Message} from 'semantic-ui-react';
import {Link} from '../routes';


export default () => {
  return (
    <Menu tabular
      size='massive'
    >
      <Menu.Item header
        name='Break Randomizer'
        widths={10}
      />
      <Menu.Menu
        position="right"
        width={110}
      >
        <Link route="/main">
          <a className="item">
            Main
          </a>
        </Link>
        <Link route="/edit">
          <a className="item">
            Edit
          </a>
        </Link>
      </Menu.Menu>
    </Menu>
  );
}
